// applying UI theme settings for search form
function getYellowTheme(){
    var theme_yellow = {
        "left" : "data:image/png;base64,",
        "right" : "data:image/png;base64,",
        "lupa" : "data:image/png;base64,"
    };

    //console.log('theme_yellow - ' , theme_yellow);
    return theme_yellow;
}

$( document ).ready(function() {
    var theme_yellow = getYellowTheme();

    //adding search vindow CSS styles
    $('.fast_search_prev').css('background','url(' + theme_yellow['left'] + ')');
    $('.fast_search_next').css('background','url(' + theme_yellow['right'] + ')');
    $('.fast_search_result').css('background','#fff').css('border','2px solid #FFED9A').css('border-radius','17px');
    $('#searchbox_id').css('border','2px solid #FFD100').css('background','url(' + theme_yellow['lupa'] + ')no-repeat').css('background-position-y','2px').css('background-position-x','98%');


// minimization of search form
    chrome.storage.sync.get('fast_search_minimal_style', function(a) {
        var x = a['fast_search_minimal_style'];
        if(x){
            minimize_search_form();
        }
        else
        {
            maximize_search_form();
        }
    });

    //minimize_search_form();
});

function maximize_search_form()
{
    $('.fast_search_result').removeClass('mini');
}


function minimize_search_form()
{
    $('.fast_search_result').addClass('mini');
}
